import React, { Component } from 'react';
import './hangman.css';
import Row from './row';
import './name';
import h0 from './images/h0.jpg';
import h1 from './images/h1.jpg';
import h2 from './images/h2.jpg';
import h3 from './images/h3.jpg';
import h4 from './images/h4.jpg';
import h5 from './images/h5.jpg';
import h6 from './images/h6.jpg';
import { randomName } from './name';
class Hangman extends Component{
    static defaultProps={
        triesLeft: 6,
        images: [h0, h1, h2, h3, h4, h5, h6]
    }
    constructor(props){
        super(props);
        this.state={
            mistake: 0,
            guessed: new Set([]),
            answer: randomName()
        }
    }
    render(){
        return (
            <div>
                <h1>Hangman</h1>
                <div className="float-right">Tries: {this.state.mistake}</div>
                <p>{this.state.answer}</p>
                <div className="text-center">
                    <img src={this.props.images[this.props.mistake]} alt=""/>
                </div>
                <Row value={0}></Row>
                <Row value={1}></Row>
            </div>
        );
    }
}
export default Hangman;
